import React from 'react'
import './Menubar.css'
import { Link } from 'react-router-dom'

const Menubar = () => {
  return (
    <div id='menubar'>
      <Link to='/addemploy'>Add Employee</Link>
      <Link to='/employlist'>Employee List</Link>
    </div>
  )
}

export default Menubar
